trainMat = trainDf.values
trainX = trainMat[:, :-1]
trainY = trainMat[:, -1]
trainX = (trainX > 0) * 1.0
newYorkLabel = (trainY == 'NewYork') * 1.0
californiaLabel = (trainY == 'California') * 1.0
georgiaLabel = (trainY == 'Georgia') * 1.0


def topPMI():
	c = np.sum(georgiaLabel) / len(georgiaLabel)
	dict = {}
	for index in range(trainX.shape[1]):
		feature = [x[index] for x in trainX]
		a = np.sum(feature) / len(feature)
		ac = 0
		a_c = 0
		ac_ = 0
		a_c_ = 0
		for x,y in zip(feature, georgiaLabel):
			if x == 1 and y == 1:
				ac += 1
		ac = ac / len(feature)
		PMI = 0
		if ac:
			PMI = math.log(ac/(a*c), 2)
		dict[index] = PMI
	sortedDict = sorted(dict.items(),key=operator.itemgetter(1),reverse=True)
	res = []
	for x,y in sortedDict:
		res.append(trainDf.columns[x])
	print (res)


def topMI():
	c = np.sum(newYorkLabel) / len(newYorkLabel)
	dict = {}
	for index in range(trainX.shape[1]):
		feature = [x[index] for x in trainX]
		a = np.sum(feature) / len(feature)
		ac = 0
		a_c = 0
		ac_ = 0
		a_c_ = 0
		for x,y in zip(feature, newYorkLabel):
			if x == 1 and y == 1:
				ac += 1
			if x == 1 and y == 0:
				ac_ += 1
			if x == 0 and y == 1:
				a_c += 1
			if x == 0 and y ==0:
				a_c_ += 1
		ac = ac / len(feature)
		a_c = a_c / len(feature)
		ac_ = ac_ / len(feature)
		a_c_ = a_c_ / len(feature)
		MI = 0
		if ac:
			MI += ac * math.log(ac/(a*c), 2)
		if a_c:
			MI += a_c * math.log(a_c/((1-a)*c), 2)
		if ac_:
			MI += ac_ * math.log(ac_/(a*(1-c)), 2)
		if a_c_:
			MI += a_c_ * math.log(a_c_/((1-a)*(1-c)), 2)
		dict[index] = MI
		
	sortedDict = sorted(dict.items(),key=operator.itemgetter(1),reverse=True)
	res = []
	for x,y in sortedDict:
		res.append(trainDf.columns[x])
	print (res)



def topChi2():
	c = np.sum(californiaLabel) / len(californiaLabel)
	dict = {}
	for index in range(trainX.shape[1]):
		feature = [x[index] for x in trainX]
		a = np.sum(feature) / len(feature)
		ac = 0
		a_c = 0
		ac_ = 0
		a_c_ = 0
		for x,y in zip(feature, californiaLabel):
			if x == 1 and y == 1:
				ac += 1
			if x == 1 and y == 0:
				ac_ += 1
			if x == 0 and y == 1:
				a_c += 1
			if x == 0 and y ==0:
				a_c_ += 1
		Eac = (a+c)/len(feature)
		Ea_c = (1-a+c)/len(feature)
		Eac_ = (a+1-c)/len(feature)
		Ea_c_ = (1-a+1-c)/len(feature)
		chi2 = 0
		if Eac:
			chi2 += pow(ac-Eac,2) / Eac
		if Ea_c:
			chi2 += pow(a_c-Ea_c,2) / Ea_c
		if Eac_:
			chi2 += pow(ac_-Eac_,2) / Eac_
		if Ea_c_:
			chi2 += pow(a_c_-Ea_c_,2) / Ea_c_
		dict[index] = chi2
	sortedDict = sorted(dict.items(),key=operator.itemgetter(1),reverse=True)
	res = []
	for x,y in sortedDict:
		res.append(trainDf.columns[x])
	print (res)
